const image = new Image();
image.src = 'data:image/png;base64,'
//design image with pixelated effect 
image.addEventListener('load', function() {
    const canvas = document.getElementById('canvas');
    const ctx = canvas.getContext('2d');
    const width = canvas.width = image.width;
    const height = canvas.height = image.height;

    ctx.drawImage(image, 0, 0);

    const imageData = ctx.getImageData(0, 0, width, height);
    ctx.clearRect(0, 0, width, height);
    
    let mappedImage = [];
    for (let i = 0; i < height; i++) {
        let row = [];
        for (let j = 0; j < width; j++) {
            const red = imageData.data[(i * 4 * imageData.width) + (j * 4)];
            const green = imageData.data[(i * 4 * imageData.width) + (j * 4) + 1];
            const blue = imageData.data[(i * 4 * imageData.width) + (j * 4) + 2];

            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness,
                cellColor = 'rgb(' + red + ',' + green + ',' + blue + ')'
            ]
            row.push(cell);
        }
        mappedImage.push(row);
    }
    function calculateRelativeBrightness(r, g, b) {
        // return Math.sqrt((r * r * 0.241) + (g * g * 0.691) + (b * b * 0.068))/100;
        return Math.sqrt((r * r) * 0.299 + (g * g) * 0.587 + (b * b) * 0.114)/100;
    }


    class Particles{
        constructor(){
            this.x = Math.random() * width;
            this.y = 0;
            this.velocity = Math.random() * 0.5;
            this.speed = 0;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        draw(){
            ctx.beginPath();
            ctx.fillStyle = mappedImage[this.position1][this.position2][1];
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
        update(){
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity;
            this.y += movement;
            if(this.y >= height){
                this.y = 0;
                this.x = Math.random() * width;
            }
        }
    }

    const particles = [];
    for(let i = 0; i < 7000; i++){
        particles.push(new Particles());
    }
    function draw(){
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0, 0, width, height); 
        ctx.globalAlpha = 0.2;
        for(let i = 0; i < particles.length; i++){
            particles[i].update();
            ctx.globalAlpha = particles[i].speed ;
            particles[i].draw();
        }
        requestAnimationFrame(draw);
    }
    draw();

})
    
                                                                   


    